import logo from './logo.svg';
import './App.css';
import TodoList from './todoList'

function App() {
  return (
    <div className="App">
      <header className="App-header">

		<TodoList />
		<input type="text" />
		<>
			<button>Add</button>
			<button>Remove</button>
		</>

      </header>
    </div>
  );
}

export default App;
